import { makeStyles } from "@material-ui/styles";

export default makeStyles((theme) => ({
  root: {
    display: "flex",
    justifyContent: "center",
    alignItems: "center",
    height: "100vh",
    display: "-webkit-box",
    display: "-ms-flexbox",
    padding: "36px 15px 10px",
    background: "url(../img/bg-sign-up.jpg) no-repeat 50% 50%/cover",
    WebkitBoxOrient: "vertical",
    WebkitBoxDirection: "normal",
    MsFlexDirection: "column",
    flexDirection: "column",
    color: "white",
  },

  buttonWrapperLogin: {
    margin: "",
    display: "flex",
    alignItems: "center",
    justifyContent: "space-between",
  },

  titleLogin: {
    marginBottom: 25,
    textAlign: "center",
    color: "white",
    marginTop: 25,
  },

  paper: {
    padding: 10,
    height: "100%",
    display: "flex",
    alignItems: "center",
    justifyContent: "center",
  },
  image: {
    display: "flex",
    alignItems: "center",
    justifyContent: "center",
  },
  content: {
    maxWidth: "500px",
    minWidth: "500px",
    backgroundColor: "#33936E",
    padding: 36,
  },
}));
